import './index.css'

function Main() {
    return (
        <div className = "main-frame">
            <h1 className = "title">#TORELAX</h1>
            <p> I have</p>
            <ellipse cx="50%" cy="50%" rx = "50%">
            </ellipse> 
            <p> to relax</p>       
        </div>
    )
}
export default Main
